import './App.css';
import ListTable from './components/ListTable.js';
import {v4 as uuidv4} from 'uuid';

const Title =()=>{
  return(
    <div id="title">
      <h1>SCAT</h1>
      <h2>SMART CONTRACT SECURITY AUDITING TEAM</h2>
      <p>SCAT is our project to analyze DeFi projects risk and weakness in smart contract, while also provide
        general risk analysis and risk factor data on the project
      </p>
    </div>
  );
}

const FilterList = [
  "All Projects",
  "Lending Projects",
  "Trading Projects",
  "Asset Projects"
]

const TableItemList = [
  {
    name:"Alpha Homura",
    category:"Lending",
    chain:"Ethereum",
    lastExploit:"13/02/2021",
    tvl:"$736.1M",
    percentChange:"+0.78%"
  },
  {
    name:"Alpha Homura",
    category:"Lending",
    chain:"Ethereum",
    lastExploit:"13/02/2021",
    tvl:"$736.1M",
    percentChange:"+0.78%"
  },
  {
    name:"Alpha Homura",
    category:"Lending",
    chain:"Ethereum",
    lastExploit:"13/02/2021",
    tvl:"$736.1M",
    percentChange:"+0.78%"
  },
  {
    name:"Alpha Homura",
    category:"Lending",
    chain:"Ethereum",
    lastExploit:"13/02/2021",
    tvl:"$736.1M",
    percentChange:"+0.78%"
  },
]

const Filter =()=>{
  return(
    <div id="filter">
      {FilterList.map((element)=>{
        return <div>{element}</div>
      })}
    </div>
  );
}

const Table =()=>{
  return(
    <div>
      <ListTable input={TableItemList} />
    </div>
  );
}


function App() {
  return (
    <div>
      <Title />
      <Filter />
      <Table />
    </div>
  );
}

export default App;
